    GameObject GetObject(int value)
    {
        switch (value)
        {
            case 1:
                return floor;
            case 2:
                return Character;
            case 3:
                return LeftStair;
            case 4:
                return RightStair;
            case 5:
                return flag;
            case 6:
                return serra;
            case 7:
                return totem;
            case 8:
                return poison;
            case 9:
                return totem_flecha;
            default:
                return floor;
        }
    }
